import React from 'react';
import TextField from '@material-ui/core/TextField';

function Login(){

    return(
        <div>
            <div style={{margin: "0 auto",width:"50%"}}>
                <TextField
                    id="standard-full-width"
                    style={{ margin: 8 }}
                    placeholder="Placeholder"
                    size="medium"
                    margin="normal"
                    InputLabelProps={{
                        shrink: true,
                    }}
                />
            </div>
        </div>
    )

}

export default Login;
